INSERT INTO `service` (`SerId`, `Name`, `Description`, `Type`, `Draft`, `NumOfPoints`, `UserName`) VALUES
(17, 'Bastino', 'A completely different place at Banovo Brdo. A totally different conceptual solution for space dominated by all colors relates to exotic places from distant destinations.', 'cafe', , 13, 'labovic23'),
(18, 'OUR', 'When beer and experience are combined, this kind of bar is exactly what you get. The spectacular offer of beer from all over the world is the main reason for the big crowd every day.', 'pub', , 6, 'labovic23');
INSERT INTO `service` (`SerId`, `Name`, `Description`, `Type`, `Draft`, `NumOfPoints`, `UserName`) VALUES
(19, 'Dilema', 'It is not a coincidence that this place is located right by the Danube. The best elements of the modern era have been placed at a perfect location and now they together offer more than a place to socialize.', 'cafe', , 8, 'labovic23'),
(20, 'Ambient', 'Very cool cafe! :)', 'cafe', , 5, 'labovic23'),
(21, 'Tramvaj', 'It represents a bastion of quality music and live club music.Atmosphere in the club Tramvaj Pub is always unique,and the energy extremely positive.Tramvaj Pub,cult Belgrade club, is located in Roosevelt Street,near The Vuk Monument in the center', 'pub', NULL, 8, 'Danilo Lalic'),
(22, 'Dolce Principessa', 'The sweetest edition of the whole planet in the center of Dorcol. This is a unique pastry shop that is impossible to miss. And it is not desirable to go through the city without stopping at the address where each woman becomes a princess.', 'cafe', , 4, 'Danilo Lalic'),
(23, 'Madera', 'Madera is located in the metropolitan area with a long history.The story goes that the restaurant got its name as one of the regular guests brought a great wine from the Portuguese island of Madeira.', 'restaurant', NULL, 18, 'Danilo Lalic'),
(24, 'Central', 'Opened in late 2017 and created in an authentic modern style. Beer lovers have recognized this location as a modern concept where every stay is perfect in a short time.', 'pub', NULL, 9, 'Danilo Lalic');
INSERT INTO `service` (`SerId`, `Name`, `Description`, `Type`, `Draft`, `NumOfPoints`, `UserName`) VALUES
(25, 'Voulez-Vous', 'This restaurant is situated in Neimar. The cosmopolitan spirit is present in attractive design and specific interior. Mediterranean chic is in the forefront of the menu. Exclusivity and simplicity, nature and the city, grandiosity and modesty', 'restaurant', , 6, 'Danilo Lalic'),
(26, 'Brener', 'The perfect balance between modern and traditional catering is intended for the admirers of large portions of delicious specialties.An impressive garden with a view of the Danube relaxes from everyday activities.', 'restaurant', NULL, 7, 'labovic23');
